import React, { Component } from "react";
import Reveal from "react-reveal/Reveal";
import Slider from "../Slider";
import { Carousel } from "react-bootstrap";
import { Link } from "react-scroll";
class InfluencersBanner extends Component {
  render() {
    let BannerData = this.props.BannerData;
    return (
      <section
        style={{ height: "50%" }}
        id="home"
        className="agency_banner_area bg_color"
      >
        <Carousel className="banner_shap">
          <Carousel.Item interval={10000}>
            <img
              style={{ width: "auto", height: "800px" }}
              className="d-block w-100"
              src={require("../../imgbackground/1547231575-og-blog_instagram.jpg")}
              alt="First slide"
            />
          </Carousel.Item>{" "}
          <Carousel.Item interval={10000}>
            <img
              style={{ width: "auto", height: "800px" }}
              className="d-block w-100"
              src={require("../../imgbackground/343635.jpg")}
              alt="First slide"
            />
          </Carousel.Item>
          <Carousel.Item interval={10000}>
            <img
              style={{ width: "auto", height: "800px" }}
              className="d-block w-100"
              src={require("../../imgbackground/182-1826005_family-travel-photos-hd.jpg")}
              alt="First slide"
            />
          </Carousel.Item>{" "}
          <Carousel.Item interval={10000}>
            <img
              style={{ width: "auto", height: "800px" }}
              className="d-block w-100"
              src={require("../../imgbackground/iStock-1280349927-1260x840.jpg")}
              alt="First slide"
            />
          </Carousel.Item>
          <Carousel.Item interval={10000}>
            <img
              style={{ width: "auto", height: "800px" }}
              className="d-block w-100"
              src={require("../../imgbackground/KF5QIGBF3FAC5CGOKHTGDWIF7A.jpg")}
              alt="First slide"
            />
          </Carousel.Item>
        </Carousel>

        <div className="container custom_container">
          <div
            style={{ justifyContent: "center" }}
            className="row align-items-center"
          >
            <div className="col-lg-5 d-flex text-center">
              <div>
                <Reveal>
                  {BannerData.AgencyText.map((Agency) => {
                    return (
                      <React.Fragment key={Agency.id}>
                        <h2
                          className="f_p f_700 f_size_50 w_color l_height50 mb_20"
                          data-wow-delay="0.3s"
                        >
                          Become a MicroGlober
                        </h2>
                        <p
                          className="f_400 l_height28 wow fadeInLeft w_color"
                          data-wow-delay="0.4s"
                        >
                          Show Yourself!
                        </p>
                      </React.Fragment>
                    );
                  })}
                  <div className="action_btn d-flex align-items-center mt_60">
                    <Link
                      spy={true}
                      smooth={true}
                      to="influencers"
                      className="agency_banner_btn_tree"
                      data-wow-delay="0.5s"
                    >
                      Sign Up
                    </Link>
                  </div>
                </Reveal>
              </div>
            </div>
          </div>
        </div>
      </section>
    );
  }
}
export default InfluencersBanner;
